// SPDX-License-Identifier: MIT
pragma solidity 0.8.0;

interface IOneClickOracleAdvanced{
  function getAllInformationPriceFeed() external view returns (uint80,int256,uint256,uint256,uint80);
  function getHistoricalPrice(address, uint80) external view returns (int256);
  function getOriginalOraclePrice(address) external view returns (int256);
  function getOraclePrice(address) external view returns (int256);
  function getDescriptionOfPriceFeed(address) external view returns (uint256);
  function getVersionOfPriceFeed(address) external view returns (uint256);
  function getLatestAnswer(address) external view returns (uint256);

  event priceFeedAdded(address indexed _token, address indexed _priceFeed);    
}
